import games from '../games.json'
import { Image } from 'react-bootstrap';

function ListMovies() {
    const a = [
        {
            "name": "Subnautica",
            "coverUrl": "https://gaming-cdn.com/images/products/1003/orig-fallback-v1/subnautica-pc-mac-jogo-steam-cover.jpg?v=1647355880"
        },
        {
            "name": "Nier Automata",
            "coverUrl": "https://i.pinimg.com/originals/9f/c5/7b/9fc57b3b12b9bca185e7e7d77d654669.jpg"
        },
        {
            "name": "Red Dead Redemption 2",
            "coverUrl": "https://theflucobeat.com/wp-content/uploads/2018/12/Red_Dead_Redemption_2_Cover_Art-729x900.jpg"
        },
        {
            "name": "Spider Man Ps4",
            "coverUrl": "https://static.wikia.nocookie.net/spidermanps4/images/d/d4/Marvel%27s_Spider-Man_front_cover_%28US%29.png/revision/latest?cb=20201003182432"
        }]
    return (
        <div className="container">
            {a.map((as) => (
                <div key={as.name} className="col">
                    <Image src={as.coverUrl} alt={as.name} width="128" height="181 " />
                </div>
            ))}
        </div>
    )
}

export default ListMovies;
